import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (modal trigger)
    await page.waitForSelector('div.cart', { timeout: 5000 });

    // Click the cart element to open the Shopping Cart Modal
    await page.click('div.cart');

    // Wait for the cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    // Wait for the modal to be visible (display: block)
    await page.waitForFunction(() => {
      const modal = document.getElementById('cartModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Take screenshot of the opened cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract some cart modal data for verification
    const modalTitle = await page.$eval('#cartModal .cart-content h2', el => el.textContent.trim());
    const cartItemsCount = await page.$$eval('#cartItems .cart-item', items => items.length);
    const cartTotal = await page.$eval('#cartTotal', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened the Shopping Cart Modal and verified its content",
      extractedData: {
        modalTitle,
        cartItemsCount,
        cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
